2	Mr. RAJA BABU	President	B.Sc.(H) STATISTICS	Dear Alumni,\r\nIt is my privilege to serve as the President of our Alumni Association. Our mission is to foster a strong, supportive network that connects past and present members of our college. We aim to create meaningful opportunities for professional growth, mentorship, and collaboration. Your active participation will make our community even stronger.	media/office_bearers/raja_babu_q7kzsn	1
8	Ms. SHEHNAZ SARONWAL	VICE - PRESIDENT	B.Sc.(H) STATISTICS	I am excited to be part of the leadership team of our Alumni Association. My focus is on strengthening communication and engagement across our network. We want every alumnus to feel connected, informed, and proud to be part of our community. Join us in building lasting relationships and contributing to the growth of our alma mater.	media/office_bearers/shehnaaz_sronval_isjmhx	2
13	Dr. Rajiv Kumar	Treasurer	Professor	It is my honor to serve as the Treasurer of the Alumni Association. I ensure that our resources are managed transparently and effectively to support all our programs and initiatives. Your support, whether through participation or contributions, helps us achieve our goals and make a lasting impact.	media/office_bearers/rajiv_kumar_zmul0h	6
5	Dr. AWADHESH KUMAR JHA	VICE - PRESIDENT	B.A.(H) HISTORY	As Vice President, I am committed to creating opportunities for alumni to give back, share their experiences, and support each other professionally and personally. We encourage you to stay connected through events, forums, and initiatives that celebrate our shared journey. Your voice and involvement matter!	media/office_bearers/awadesh_kumar_ahljyx	2
6	Mr. TARUN SRIVASTAVA	GENERAL SECRETARY	B.COM(P)	It is a pleasure to serve as the General Secretary of the Alumni Association. I am responsible for keeping you informed about all activities, events, and opportunities. We encourage you to engage with the portal regularly, participate in initiatives, and help us strengthen the alumni community. Together, we can achieve more!	media/office_bearers/tarun_srivastav_dm3uv1	3
7	Mr. NITIN AGNIHOTRI	JOINT SECRETARY	B.Sc.(H) MICROBIOLOGY	I am thrilled to connect with you as Joint Secretary. My role is to support communication, organize events, and ensure that our alumni network remains vibrant and interactive. We value your ideas, suggestions, and active participation in making this association truly impactful.	media/office_bearers/nitin_agnihotri_nbcyru	4
9	Mr. ANUJ SAMVEDI	JOINT SECRETARY	B.Sc.(H) STATISTICS	As Joint Secretary, I focus on building a dynamic and inclusive alumni network. We aim to create opportunities for networking, collaboration, and engagement. Your contributions, whether big or small, are vital in strengthening the bond of our alumni community. Lets stay connected!	media/office_bearers/anuj_samvedi_c1pqgf	5
