COPY public.alumniportal_testimonial (id, name, course, batch, message, image, linkedin, created_at, "position", deleted_at, is_deleted) FROM stdin;
11	Paridhi Verma	B.A. (H) English	2021-2024	It is often said that school life leaves the strongest memories, but for me, it was my undergraduate experience at Ram Lal Anand College that stands out the most. Each day brought something new, from classrooms that balanced learning with freedom to student clubs, especially SPIC MACAY, which helped me build skills I still use in both professional settings and my personal life.\r\n\r\nThe faculty balanced the classroom environment so beautifully that it never felt mechanical and fostered deep thinking. The gardens and flowers added to the sublime one could feel in the quiet afternoons of college. The staff and the overall campus atmosphere ensured that the college remained a space for holistic development. The feedback was always prompted addressed and I still remember the reading room which was opened to ensure students can manage both clubs and studies till evening.	media/testimonials/Paridhi_cmnc0n	\N	2026-02-09 01:12:09.30734+05:30	0	\N	f
9	Ishan Verma	B.Sc (H) Computer Science	2020-2023	Ram Lal Anand College was where I learned the importance of building strong fundamentalsboth academically and personally. My time at RLAC taught me discipline, critical thinking, and the value of learning from mentors and peers. It was here that I understood how consistency, curiosity, and self-belief form the base of any meaningful journey.\r\n\r\nLife after college reinforced these lessons in powerful ways. Real-world challenges taught me adaptability, patience, and the importance of continuous upskillingthings I now realize were quietly being prepared for during my college years. Situations outside the classroom made me appreciate how deeply the values learned at RLAC influence decision-making, work ethic, and resilience.\r\n\r\nLooking back, RLAC did more than educateit prepared me to learn, unlearn, and grow. To current students, I would say: trust the process, stay open to learning, and remember that the lessons you gain here will guide you long after college ends.	media/testimonials/Ishan_Verma_kb1xp9	https://www.linkedin.com/in/ishan-verma-2404a4230	2026-02-09 01:02:45.234537+05:30	0	\N	f
7	Shashwat Razdan	B.Tech. Computer Science	2013-2017	Attending Ram Lal Anand College has been a pivotal part of my life. It has taught me not only the technical skills to build a solid career but also how to stay hungry in a world that never stops changing. Lately, Ive become someone who refuses to settle, moving from the classroom to the forefront of the tech industry while keeping my curiosity alive. Ive learned that growth isnt just about the position you hold, its about the daily hustle, the constant learning, and the drive to create things that actually matter.	media/testimonials/shashwat_wmq5x9	https://www.linkedin.com/in/shashwatrazdan	2026-02-09 00:56:06.632925+05:30	0	\N	f
6	Vishal Tyagi	B.Sc(H) Computer Science	2017-2020	Ram Lal Anand College played a key role in shaping how I think and approach my work. My time studying Computer Science helped me build strong problem-solving skills, discipline, and the confidence to take ownership of my learning. Beyond academics, the faculty, peer interactions, and overall campus environment encouraged curiosity, independent thinking, and adaptability, qualities that continue to guide me in my professional journey. RLA gave me a solid foundation not just for a career, but for long-term growth, and Im proud to be an alumnus.	media/testimonials/vishal_k2pkme	https://www.linkedin.com/in/vishal-tyagi-0babbb13a/	2026-02-09 00:52:18.365403+05:30	0	\N	f
17	Sweta Puppet	B.Sc. (H) Statistics	2004-2007	Pursuing a B.Sc. in Statistics from RLA College was one of the best decisions I made for my future career. The teachers and their depth of knowledge helped build a strong foundation in Statistics, which proved immensely helpful during my Masters in Statistics.\r\n\r\nI firmly believe that my education at RLA College has played a crucial role in shaping where I am today. Teachers such as Seem Gupta, Rita Jain, Rajesh Sachdev, Mukta Dutta, and Seema Joshi not only strengthened our academic understanding but also helped us grow as individuals.\r\nMy advice to current and future students of RLA College is to lead a disciplined lifeattend all classes regularly, study consistently at home or in the library, and never hesitate to ask questions. These habits will greatly enhance your knowledge and help you build a strong base in Statistics.\r\nI wish all the very best to the current and future students of RLA College and hope they achieve great success in their lives.	media/testimonials/Sweta_Puppet_ztoi7b	\N	2026-02-09 01:34:38.01765+05:30	0	\N	f
15	Raphael Jose	B.A. (H) English	2007-2010	I will always remember RLA as the place that opened a new world to mea world of creativity and art. It was the encouragement and support of my teachers in the English department that inspired me to explore beyond the classroom which opened doors that made me who I am. RLA and the English department will always hold a special place in my heart.	media/testimonials/Raphael_jose_mdbd1y	\N	2026-02-09 01:26:32.128438+05:30	0	\N	f
14	Rudrakshi Jain	B.A. (H) English	2021-2024	Graduating with a BA (Hons) in English from Ram Lal Anand College in 2024 was more than just an academic milestone; it was a journey of self-discovery. I look back at the brilliant classroom discussions led by our wonderful faculty Taha Sir, Urvashi Maam, Pragya Maamas the foundation of my critical thinking. Their mentorship didn't just help me understand literature; it helped me understand life. But my education didn't stop at the classroom door.\r\nMy time as Captain of the Volleyball Team under Vishal Sir and Vice Captain of the Photography Club with Manvesh Sir shaped my character and confidence. These leadership roles, combined with the invaluable community service experiences in NSS with Rita Maam, were the true catalysts in my transformation from a young girl into a determined woman, ready to take on the world. Thank you, RLA, for being the wind beneath my wings!	media/testimonials/Rudrakshi_Jain_gqxfka	\N	2026-02-09 01:20:22.822953+05:30	0	\N	f
13	Megha Banerjee	B.A. (H) English	2021-2024	College was more than just an academic pursuit for me; it was an experience that channelled curiosity, valued every voice, and nurtured growth. The lessons from the classroom and beyond have left a lasting imprint, continually guiding my professional journey and personal evolution. I carry the institution's foundational values with me always.	media/testimonials/Megha_Banerjee_upgacb	https://www.linkedin.com/in/megha-banerjee-091484226?utm_source=share_via&utm_content=profile&utm_medium=member_android	2026-02-09 01:18:12.808652+05:30	0	\N	f
12	Tanya	B.A. (H) English	2016-2019	My three years at the college shaped not only my academic pursuits but also my way of thinking and engaging with the world. The intellectual culture of the English department, marked by remarkable theoretical engagement, nurtured in me a habit of critical inquiry that continues to guide my work today. During my time there, I remained closely involved in the life of the campus, serving as Vice President of the Debating Society and as a founding member, and later President, of the literary society Ubiquitous. More than accolades, what the college offered me was a lasting lesson in humility, curiosity, and academic integrity. The foundations of my engagement with literature were firmly laid here, and they continue to shape my present journey as a teacher of literature at Ramjas College, University of Delhi, as well as my work as a poet, most recently in my collection The Weight of Wings and Other Things.	media/testimonials/Tanya_ons0tx	https://www.linkedin.com/in/tanya-a66107314	2026-02-09 01:16:21.842047+05:30	0	\N	f
8	Dr. Rajan Gupta	B.Sc (H) Computer Science	2005-2008	My journey in the world of computer science began at Ram Lal Anand College, University of Delhi (Batch of 20052008). It was here that curiosity met opportunity. Surrounded by brilliant peers and guided by passionate faculty, I discovered my deep interest in computer science, mathematics, and the power of analytical thinking. The spirit of competition and collaboration on campus constantly pushed me to learn beyond textbooks  to question, explore, and innovate.\r\n\r\nToday, as I lead Data Science and AI/ML teams for Deutsche Telekom  one of Europes largest telecom organizations  I often reflect on how those formative years at RLA shaped my professional philosophy. The college nurtured in me a discipline of continuous learning and a belief that technology, when used creatively, can transform both businesses and lives.\r\nFrom developing scalable AI systems that enhance customer experiences and drive employee productivity to mentoring the next generation of data scientists, every achievement of mine carries the imprint of RLAs values  curiosity, resilience, and excellence.\r\nTo all current students: never underestimate the power of your beginnings. RLA gives you every foundation to dream big and build fearlessly. The world needs thinkers and builders  and youre already on the right path.	media/testimonials/Ranjan_Gupta_wzncfc	https://www.linkedin.com/in/rajan-gupta-cap/	2026-02-09 00:59:34.359862+05:30	0	\N	f
21	Yash Chaudhary	B.Sc (H) Microbiology	2013-2016	The period spent in college is often considered the most joyful time in ones life. After finishing school, many individuals start to ponder where to kick off their careers, which exams to pursue, and which college aligns best with their aspirations. Likewise, I entered this college brimming with dreams and hope. It shapes who I am today. I believe RLAC is ideal in every aspect, whether it be academics, faculty, sports, or extracurricular activities. It was truly a second home for me. I encountered a variety of remarkable individuals, forged lifelong friendships, and made mistakes that taught me valuable lessonscontributing to my personal growth. Its a place I didnt physically attend, but also cherished every moment. One should approach college days without skepticism, as it is widely recognized that all the challenges and obstacles faced ultimately served a purpose. Every moment spent there brought its own joy, whether it was socializing, studying intensely (or not at all), or celebrating accomplishments. The days at RLAC were filled with excellent grades, wonderful friendships, unforgettable trips (both to Gyanodaya and within the Department), numerous life lessons about self-reliance, practical experiences, and countless moments that shaped my perspective on life. I still find joy in reminiscing about those cherished days. My undergraduate years pushed me to invest more effort into my studies, ingraining a strong work ethic in me. This was made possible by the invaluable encouragement and support from my teachers, who consistently motivated me in every way they could. They are the true champions of our college experience, instilling in us the importance of being good human beings first, followed by everything else. They have been instrumental in elevating\r\nRLAC to its highest level. I am deeply thankful to them. It gives me immense pleasure to be an alumnus of RLAC.	media/testimonials/Yash_Chaudhary_hqg8sv	\N	2026-02-09 01:54:18.04113+05:30	0	\N	f
20	Anurag Singh	B.Sc (H) Microbiology	2018-2021	As I write this note for my alma mater Ram Lal Anand College, University of Delhi, I am filled with profound gratitude for the instrumental role it played in shaping my academic journey. My B.Sc. (Hons.) in Microbiology (2018-2021) at RLAC was a transformative experience that went far beyond textbooks and lectures, fostering a genuine passion for scientific inquiry. The academic rigor and comprehensive curriculum at RLAC prepared me exceptionally well for the challenges ahead. During my time here, I had the privilege of serving as the President of Mikrobiologika, the college's microbiology society. I was also honoured to receive the Academic Excellence\r\nAward and the Best Student Award (Sciences)  an achievement that perfectly sums up my journey at RLAC. The education I received here placed me in a strong position to pursue my academic aspirations. I went on to pursue my Masters in Virology at prestigious ICMR-National Institute of Virology, Pune, where I was awarded the gold medal. Today, as I navigate the challenges of doctoral research, as a PhD Scholar at the All India Institute of Medical Sciences (AIIMS), New Delhi, I often reflect on how my undergraduate years equipped me with the necessary skills and knowledge to excel in these prestigious institutions.\r\nWhat sets RLAC apart is its commitment to holistic development. The mentoring I received from the faculty was invaluable  they didn't just teach the subject matter; they inspired scientific curiosity and critical thinking. The blend of practical training and theoretical knowledge provided a competitive edge that has served me well throughout my academic journey. To current and future RLAC students, I want to emphasize that you are at an institution that truly prepares you for excellence. The foundation you receive here is robust enough to support whatever heights you aspire to reach in your career.\r\nMy journey from RLAC to becoming a researcher at India's premier medical institution stands as a testament to the quality of education and mentoring that RLAC provides. I remain forever indebted to this institution for setting me on the path to academic excellence and scientific research.	media/testimonials/Anurag_jmmc0q	\N	2026-02-09 01:50:53.407034+05:30	0	\N	f
19	Lalit Mohan	B.Sc. Hons Microbiology	2017-2020	My journey unwinding science and exploring curiosity about the unknown began at Ram Lal Anand College, University of Delhi. I experienced a truly revolutionary journey there. The professors were immensely supportive and encouraging of my overall skill set development beyond the classroom. The faculty members are experts in their fields and genuinely invested in student success. Their guidance and mentorship have helped me gain confidence in my abilities and explore new opportunities. I also participated in two research projects, which further widened my horizons in the scientific world. Regular seminars and hands-on workshops provided current knowledge in the scientific domain.  \r\nBeyond academics, the vibrant student life, clubs, and extracurricular activities have enabled me to forge lifelong friendships and develop essential skills that extend beyond the classroom. I was part of the National Service Scheme (NSS) for two years. The NSS instilled leadership qualities and a sense of belonging to society. Various social activities, such as educational camps, helped me gain a deeper understanding of the community.  \r\nI am grateful for the opportunities Ive had here! Nostalgia still hits whenever I visit back to meet all the Professors.	media/testimonials/Lalit_Mohan_u3drre	\N	2026-02-09 01:44:52.422674+05:30	0	\N	f
18	Ritika Sethi	BA Programme	2018-2021	My experience as a BA Programme student in History and Political Science at Ram Lal Anand College has been truly enriching. The faculty are highly knowledgeable and approachable, encouraging critical thinking, discussion, and a deeper understanding of social and political realities. The curriculum, combined with seminars, projects, and extracurricular activities, helped me develop strong analytical and communication skills. RLAC provided a supportive academic environment that played a significant role in shaping my academic growth and confidence.	media/testimonials/Ritika_Sethi_porbjk	http://linkedin.com/in/ritika-sethi-940aba283	2026-02-09 01:41:14.097603+05:30	0	\N	f
16	Soumyadeep Maiti	B.sc (H) Statistics	2004-2007	My name is Soumyadeep Maiti, and I had the privilege of studying Statistics at RLA College from 2004-2007. I am currently Director of Data Science at an AI consulting company in the USA, and I want to express my deep gratitude to the institution, particularly the esteemed professors of the Statistics Department, for their pivotal role in shaping my career.\r\n\r\nReflecting on my time at RLA, three key aspects significantly contributed to my professional growth: Foundational Knowledge, Support Beyond Academics and Collaborative Learning Environment.\r\n\r\nThe clarity of faculty in teaching core statistical concepts, along with their patience and openness for further discussion, allowed me to build a strong foundation. This knowledge has been invaluable throughout my career, especially as I transitioned into advanced fields like machine learning and data science.\r\n\r\nThe support I received extended far beyond classroom learning. I was involved in sports, reaching the finals in football and cricket, and helped organize the first Statistics festival, Random Walk. Additionally, I was allowed extra hours for computer practicals, which enhanced my collaborative and leadership abilities. These experiences played a crucial role in shaping my career trajectory. I was also encouraged to explore interdisciplinary subjects like Mathematical Economics, which broadened my understanding of the applications of statistics.\r\n\r\nThe camaraderie and healthy competition among my peers contributed to a rich, collaborative learning environment. The exchange of diverse ideas and perspectives greatly influenced my personal and academic growth during my time at RLA.\r\n\r\nTo the current students, I offer this advice: embrace the diversity of your experiences, focus on building a strong foundation, and seek learning opportunities beyond the classroom. The skills you acquire nowboth technical and interpersonalwill significantly shape your future career.	media/testimonials/soumyadee_maiti_xt2r1l	\N	2026-02-09 01:29:28.40542+05:30	0	\N	f
10	Shivam Verma	B.A. (H) English	2015-2018	I am Shivam Verma, a graduate of the 20152018 batch of English Honours at Ram Lal Anand College, University of Delhi. My years at RLA were truly formative, enriching me both academically and personally.\r\nThe English Department provided me with a strong foundation in literary studies, critical thinking, and research-oriented learning. The guidance and encouragement of my teachers inspired me to explore literature deeply and pursue academic excellence. Alongside academics, my experience as the President of Parda: The Film Club of Ram Lal Anand College (20172018) helped me develop leadership, teamwork, and organizational skills, which continue to guide me in my professional journey.\r\nToday, I am working as an Assistant Professor in the Department of English at Sri Aurobindo College, University of Delhi. I have also taught English Literature at Gautam Buddha University. Actively engaged in research and writing, I have published papers in several journals and presented my work at national and international conferences. My academic interests include Indian Literature, Partition Literature, Translation Studies, and Disability Literature. Currently, I am pursuing a Ph.D. in the Department of English at the Central University of Jammu.\r\nI remain deeply grateful to Ram Lal Anand College for nurturing my intellectual curiosity and confidence. The supportive academic environment and dedicated faculty played a crucial role in shaping my career. I encourage current students to make the most of the opportunities offered here and to engage wholeheartedly in both academics and co-curricular activities.\r\nI feel proud to be an alumnus of Ram Lal Anand College and wish the institution continued growth and success in the years to come.	media/testimonials/Shivam_Verma_mffpqx	https://www.linkedin.com/in/shivam-verma-940246125?utm_source=share&utm_campaign=share_via&utm_content=profile&utm_medium=android_app	2026-02-09 01:07:33.123229+05:30	0	\N	f
